import React from 'react';
import '../styles/home.css';

export default function Home() {
    return (
        <div className="main container-fluid mb-4 mt-2">
            <div className="d-flex flex-wrap justify-content-center rowmain">


                <div className="rightmain flex-shrink-1 ">
                    <h1 className="name"> Angelica Hernandez </h1>
                    <div className="jobtitle"> <h2> UX | UI Designer </h2>
                        <h2> Full Stack Developer</h2>
                    </div>
                </div>
            </div>

        </div>
    );
}
